    const name="mama";
    const handleClick = (e) =>{
        console.log('button clicked',e);
        console.write(name);
    }

    const handleClickAgain=(name)=>{
        console.log('Hello '+ name);
    }
    return ( 
        <div className="Home">
            <h2>Homepage</h2>
            <button onClick={handleClick}>Click Me</button>
            <button onClick={()=>handleClickAgain('loki')}>Click Me Again</button>
        </div>
     );
}

export default Home;
